SELECT DISTINCT ?this
WHERE {
	() <http://topbraid.org/sparqlmotionfunctions#localSubjects> ?this .
	FILTER (?this != teamwork:Vocabulary && NOT EXISTS {
		?this rdfs:subClassOf teamwork:Vocabulary .
	} && NOT EXISTS { ?this a owl:Ontology } && NOT EXISTS { ?this a teamwork:Vocabulary } && !tosh:isReificationURI(?this))
}

SELECT $this
WHERE {
	BIND (IRI(CONCAT(str(edg:Stewardship), '-', afn:localname($this))) AS ?ps) .
    FILTER NOT EXISTS {
		edg:Stewardship sh:property ?ps .
		?ps a sh:PropertyShape .
		?ps sh:path $this .
	}
}

# Query to produce matching property shapes
CONSTRUCT {
	edg:Stewardship sh:property ?ps .
	?ps a sh:PropertyShape .
	?ps sh:nodeKind sh:IRI .  # Optional
	?ps sh:path ?property .
	?ps rdfs:isDefinedBy <http://edg.topbraid.solutions/1.0/schema/governance> .
}
WHERE {
	?property a edg:WorkflowParticipantProperty .
	BIND (IRI(CONCAT(str(edg:Stewardship), '-', afn:localname(?property))) AS ?ps) .
}
